import CityDetails from "../components/CityDetails";
import Header from "../components/Header";
import { useForecast } from "../contexts/ForecastContext";

function Forecast({ children, cities, onClick, imperial, onCityLookup }) {
    document.title = "Prognoza";

    const { citiesState, handleCity, handleSearchCity } = useForecast();
    // cities = { citiesState };
    // onClick = { handleCity };
    // onCityLookup = { handleSearchCity };

    return (
        <div>
            <Header />
            <div className="city-lookup">
                <form onSubmit={handleSearchCity}>
                    <input type="text" placeholder="Wpisz miasto" />
                </form>
            </div>
            <div className="forecast-container">
                {citiesState.map((city) => {
                    return (
                        <CityDetails
                            city={city}
                            key={city}
                            onClick={handleCity}
                        />
                    );
                })}
            </div>
        </div>
    );
}

export default Forecast;
